(13,	'Week Roster',	'Week Roster - Employee',	'%employeename% - Provide Store Owner Name\r\n%week_roster% - Week Roster\r\n%sitename% - Provide Site Name',	'Roster for Current Week',	'<p>\r\n Hello %employeename%, &nbsp;</p>\r\n<p>\r\n Your Current Week Roster is&nbsp;</p>\r\n<p>\r\n Roster Destails:</p>\r\n<p>\r\n &nbsp;</p>\r\n<p>\r\n %week_roster%</p>\r\n<p>\r\n &nbsp;</p>\r\n<p>\r\n Thank you</p>\r\n<p>\r\n %sitename% Team</p>\r\n<p>\r\n &nbsp;</p>\r\n<table cellpadding=\"0\" cellspacing=\"0\" height=\"184\" width=\"253\">\r\n <tbody>\r\n  <tr>\r\n   <td>\r\n    Hello %employeename%,</td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    &nbsp;</td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    <p>\r\n     Your Current Week Roster is&nbsp;</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    Roster Destails:</td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    <p>\r\n     &nbsp;</p>\r\n    <p>\r\n     %week_roster%</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    <p>\r\n     &nbsp;</p>\r\n    <p>\r\n     Thank you</p>\r\n   </td>\r\n  </tr>\r\n  <tr>\r\n   <td>\r\n    %sitename% Team</td>\r\n  </tr>\r\n </tbody>\r\n</table>\r\n<p>\r\n &nbsp;</p>\r\n',	'2016-06-08 23:18:25');
INSERT INTO `stoma_module` (`moduleid`, `module`, `module_description`, `module_detailed_info`, `price_1months`, `price_3months`, `price_6months`, `price_12months`, `free_days`, `status`, `insertdate`, `insertip`, `insertby`, `editdate`, `editip`, `editby`) VALUES
(1,	'Roster',	'<p>\r\n Roster Module</p>',	'<p>The Employee Roster module provides a centralized view of all employees within the organization. </p><p>It allows administrators and managers to easily manage employee roster, availability, and assignments. </p>With intuitive search and filtering, teams can quickly access employee details, track workforce distribution, and ensure accurate staffing across departments.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 12:13:37',	'83.71.20.123',	1),
(2,	'Time Off Request',	'<p>\n Time Off Request Module</p>\n',	'<p>\nSimplified tracking for employee vacation and sick days.</p>\n <p>\nEmployees enter their requests (paid time off, sick leave, etc).</p>\n <p>\nManagers decide to either approve or refuse time off requests.</p>\n<p>\nNotification is sent to the employee and their calendar is updated automatically.</p>',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2025-10-13 14:57:26',	'83.71.20.123',	0),
(3,	'Resignation',	'<p>\r\n Resignation Module</p>',	'<p>The Employee Resignation module helps organizations record and manage employee exits.</p> It captures resignation dates, reasons, notice periods, and status changes, ensuring accurate records and smooth offboarding processes.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-10-23 08:33:39',	'115.118.115.94',	0,	'2026-01-29 12:03:20',	'83.71.20.123',	1),
(4,	'Clock in-out',	'<p>\r\n Clock in-out Module</p>',	'<p>The Employee Clock InOut module records employee attendance by tracking clock-in and clock-out times.</p> It supports accurate timekeeping, helps monitor work hours, and provides reliable data for payroll and performance analysis.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 12:05:00',	'83.71.20.123',	1),
(5,	'Employee Documents',	'<p>\r\n Documents Module</p>',	'<p>The Employee Documents module provides a secure repository for storing and organizing employee files such as contracts, IDs, certifications, and HR records.</p> It ensures easy access, document versioning, and improved compliance.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 12:05:57',	'83.71.20.123',	1),
(6,	'Employee Payroll',	'<p>\r\n Employee Payroll Module</p>',	'<p>The Employee Payroll module simplifies payroll processing by managing salaries, deductions, allowances, and payment records.</p> It integrates attendance and employee data to ensure accurate and timely payroll calculations.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 13:51:32',	'83.71.20.123',	1),
(7,	'Refund Management',	'<p>\r\n Refund Management Module</p>',	'<p>The Customer Sales Refund Management module enables businesses to process and track sales refunds.</p>\r\nIt ensures accurate refund records, supports audit trails, and helps maintain transparency in customer transactions.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-11-04 01:16:09',	'182.70.124.167',	0,	'2026-01-29 13:50:49',	'83.71.20.123',	1),
(8,	'Daily Sales',	'<p>\r\n Daily Sales Module</p>',	'<p>The Daily Sales Data module provides a detailed overview of daily sales transactions.</p> It helps businesses monitor revenue trends, track performance, and make informed operational and financial decisions.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-11-04 23:16:58',	'115.118.115.94',	0,	'2026-01-29 13:50:44',	'83.71.20.123',	1),
(9,	'Gift Voucher',	'<p>\r\n Gift Voucher Module</p>',	'<p>The Gift Voucher Sales module manages the sale and redemption of gift vouchers.</p> \r\nIt provides visibility into voucher balances, usage history, and revenue generated from gift voucher programs.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-11-04 23:18:03',	'115.118.115.94',	0,	'2026-01-29 13:50:40',	'83.71.20.123',	1),
(10,	'Bank Reconciliation',	'<p>\r\n Bank Reconciliation Modules</p>',	'The Bank Reconciliation module matches recorded sales with bank statements to ensure financial accuracy. It helps identify discrepancies, validate payments, and maintain reliable financial records.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-11-04 23:24:55',	'115.118.115.94',	0,	'2026-01-29 13:50:36',	'83.71.20.123',	1),
(11,	'Employee',	'<p>\r\n Employee</p>',	'<p>Manage, store all your employee details, profiles, roles, and status in one place.<p>\r\n<p>Centralize all your HR information.</p>',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2015-11-04 23:24:55',	'115.118.115.94',	0,	'2026-01-29 12:02:33',	'83.71.20.123',	1),
(13,	'Daily Operation Report',	'<p>\r\n Daily Report</p>',	'<p>The Daily Operation Report module consolidates key operational metrics into a single daily report.</p> It provides insights into sales, workforce activity, and operational efficiency to support daily decision-making.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 13:50:57',	'83.71.20.123',	1),
(17,	'Suppliers',	'<p>Suppliers</p>',	'<p>The Suppliers module stores and manages supplier details, their products, contact information, agreements, you add edit supplier ordering products for your store. </p>It helps streamline procurement processes and maintain strong supplier relationships.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2016-09-01 00:00:00',	'95.44.153.173',	0,	'2026-01-29 12:11:59',	'83.71.20.123',	1),
(19,	'Products',	'<P>Manage products and link them to suppliers.</P>',	'<P>The Products module allows businesses to define and manage products, including pricing, categorization, and supplier associations. </P>By linking products to suppliers, it ensures accurate ordering, stock tracking, and procurement workflows. This module requires the Suppliers module to be configured.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2016-09-11 14:15:29',	'95.44.153.173',	0,	'2026-01-29 12:25:11',	'83.71.20.123',	1),
(21,	'Tax Settings',	'<P>Configure tax rules for purchasing and orders.</P>',	'<P>The Tax Settings module allows businesses to define and manage tax rules applied to purchase orders and transactions. </P><P>It ensures accurate tax calculations during ordering and supports compliance with applicable tax requirements. </P>This module is used in conjunction with the Ordering module.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2016-09-12 04:51:58',	'95.44.153.173',	0,	'2026-01-29 12:26:09',	'83.71.20.123',	1),
(23,	'Purchase Ordering',	'<P>Purchase Ordering</P> PLEASE NOTE Purchase Ordering needs Suppliers and Products Module to be installed',	'<P>The Ordering module enables businesses to create, track, and manage purchase orders linked to registered suppliers. </P><P>It streamlines procurement by recording order details, quantities, and status, ensuring accurate purchasing and clear supplier coordination. </P>PLEASE NOTE Purchase Ordering needs Suppliers and Products Module to be installed',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2016-09-12 13:56:36',	'',	0,	'2026-01-30 17:20:46',	'83.71.20.123',	1),
(24,	'Stock Control',	'<p>\r\nStock Control</p>',	'<p>The Stock Control (Manual) module enables users to manage inventory by manually recording stock movements and adjustments.</p> It provides clear visibility into current stock levels and supports accurate inventory tracking where automated systems are not in use.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 12:22:00',	'83.71.20.123',	1),
(25,	'Catalog Products',	'<p>\nCatalog Products</p>',	'\n<p>With catalogue products module, you can list all your products that you sell in your store.</p>\n\n<p>\nFirst create all your Catalogue Groups, assign Catalogue category to each group, ready to create your products. For each product you can add name, price, description, tax value, ingredients used and determine profit margin.</p>\n\n<p>\nCatalogue products also linked with POS module and also with Stock take.</p>\n',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 13:51:23',	'83.71.20.123',	0),
(26,	'Employee Reviews',	'<p>Employee Reviews</p>',	'<p>The Employee Reviews module supports structured performance evaluations by recording reviews, feedback, and assessment outcomes.</p> It helps managers track employee development, document performance history, and support fair appraisal processes.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 13:51:09',	'83.71.20.123',	1),
(27,	'Store Documents',	'<p>\nStore Documents</p>',	'',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2025-10-13 14:58:25',	'83.71.20.123',	0),
(28,	'Point Of Sale',	'<p>\nPoint Of Sale</p>',	'',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2025-10-13 14:57:37',	'83.71.20.123',	0),
(29,	'Bookings/Reservation',	'<p>\r\nBookings/Reservation</p>',	'<p>The Bookings (Reservations) module allows businesses to create, manage, and track customer reservations.</p> It provides visibility into booking status, schedules, and availability, helping ensure smooth planning and efficient service delivery.',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'0000-00-00 00:00:00',	'',	0,	'2026-01-29 13:51:03',	'83.71.20.123',	1),
(31,	'Sinan Test',	'test',	'test detailed info',	0.00,	0.00,	0.00,	0.00,	90,	'Enable',	'2026-01-29 17:19:43',	'83.71.20.123',	1,	'2026-01-29 17:19:43',	'83.71.20.123',	1);
