(1,	'Terms of Service',	'Terms of Service',	'Terms of Service',	'Terms of Service',	'TERMS OF SERVICE\r\n<p>By using any of the MaxiManage web sites (in these terms we call these sites and any successor sites, and any software provided by MaxiManage Ltd. for use with the site, \"Service\", \"Site\", \"Application\", \"Software\" and in relation to MaxiManage Limited and/or MaxiManage, \"we\", \"us\", \"our\" and terms of similar meaning), or any other services of MaxiManage Ltd you are agreeing to be bound by the following terms and conditions (\"Terms of Service\"). </p>\r\n<p>MaxiManage Ltd. reserves the right to update and change the Terms of Service from time to time without notice. Any new features that augment or enhance the current Service, including the release of new tools and resources, shall be subject to the Terms of Service. Continued use of the Service after any such changes shall constitute your consent to such changes. If you do not agree with the changes you can cancel your account with us without further obligation, except for the amount due for the balance of the billing period in which you cancel your account. </p>\r\n\r\n1. SETTING UP AND USING YOUR ACCOUNT\r\n\r\n<p>1.1 REGISTRATION TERMS</p>\r\n\r\n<p>To register and use the Service, you must: </p>\r\na. provide your full legal name, a valid email address, and any other information reasonably required in order to complete the signup process;\r\nb. be 18 years of age or older;\r\nc. be a human. Accounts registered by \"bots\" or other automated methods are not permitted;\r\nd. promptly discharge all charges and other monthly fees as they fall due to access and use the Service; and \r\ne. comply with these Terms of Service.\r\n\r\n<p>You are responsible at all times: </p>\r\na. for maintaining the security of your account and password. MaxiManage Ltd. cannot and will not be liable for any loss or damage from your failure to comply with this security obligation; and\r\nb. for all content posted and activity that occurs under your account. \r\n<p>1.2 MODIFICATIONS TO THE SERVICE AND PRICES</p>\r\n\r\n<p>MaxiManage Ltd. reserves the right at any time and from time to time to modify, temporarily or permanently, the Service (or any part thereof) with or without notice.\r\nPrices of all Services, including but not limited to monthly subscription plan fees to the Service, as are displayed at this Site or otherwise notified to you from time to time are subject to change upon 30 days notice from us. Such notice may be provided at any time by posting the changes to this Site or the Service itself.\r\nMaxiManage Ltd. shall not be liable to you or to any third party for any modification, price change, suspension or discontinuance of the Service. </p>\r\n1.3 PAYMENT AND REFUNDS TERMS\r\n\r\n<p>A valid credit card is required for paying accounts.\r\nThe Service is billed to you in advance on a monthly basis and is non-refundable. There will be no refunds or credits for partial months of Service, or refunds for months unused with an open account. In order to treat everyone equally, no exceptions will be made.\r\nAll fees are exclusive of all taxes, levies, or duties imposed by taxing authorities, and you shall be responsible for payment of all such taxes, levies, or duties, excluding only the European Union for VAT. </p>\r\n1.4 CANCELLATION AND TERMINATION OF YOUR ACCOUNT\r\n\r\n<p>Subject to these Terms of Service, you may cancel your account at any time by logging into MaxiManage and selecting the \'Account\' page. You are solely responsible for properly cancelling your account. An email or phone request to cancel your account is not considered cancellation. </p>\r\n<p>Your account will continue and monthly subscription fees and charges will continue to accrue until such time as your account is cancelled or terminated in accordance with these Terms of Services. </p>\r\n<p>All of your content will be immediately deleted from the Service upon cancellation or termination. This information cannot be recovered once your account is cancelled. \r\nIf you cancel the Service before the end of your current paid up month, your cancellation will take effect immediately and you will not be charged again. </p>\r\n<p>MaxiManage Ltd may terminate your account at any time upon notice should you violate these Terms of Service or otherwise fail to comply with your obligations hereunder. </p>\r\n<p>Verbal, physical, written or other abuse (including threats of abuse or retribution) of any MaxiManage Ltd. customer, client, employee, member, or officer will result in immediate account termination. </p>\r\n\r\n\r\n2. CONTENT, OWNERSHIP AND PROHIBITED USES\r\n\r\n<p>OUR CONTENT. </p>\r\n\r\n<p>You expressly acknowledge that the Site, the Software and the Service developed by or on behalf of MaxiManage Ltd Limited each contain information, text, files, software, applications, code hidden text, databases, pictures, photographs, video footage, graphics, music, sounds and other material (the \"Materials\") that are protected by copyright, trademarks, trade secrets, patents, designs or other proprietary and intellectual property rights (the \"IPR\"), and that these IPRs are valid and protected in all forms, media and technologies existing now or developed later and that all right, title and interest in and to the Materials, the Site, the Software, the Service and all IPR therein are and shall remain the exclusive property of MaxiManage Ltd Limited. </p>\r\n<p>GRANT OF LICENCE. </p>\r\n\r\n<p>Upon registration and during the continuance in force of your account, MaxiManage Ltd Limited shall and hereby grants you a non-exclusive, royalty-free, non-transferable, revocable license under the IPR in the Software and the Service to use the Software and/or the Service for your personal non-commercial purposes only, subject to these Terms of Service. </p>\r\n\r\n<p>NO IMPLIED LICENCE. </p>\r\n\r\n\r\n<p>Except as explicitly granted in these Terms of Service, no licen